import Reacrt from 'react'
import NewLineTable from "../NewLineTable/NewLineTable";

const MainData = (props) => {
    if (props.data) {
        console.log(props.data.data)
    }
    // <tr>{for (let key in tr) { return <td>tr[key]</td>}}</tr>
    if (props.data) {
        let arr = props.data.data.map(tr => (<NewLineTable data={tr}/>))
    }
    return (
        <table>
            {arr}
        </table>
    )
}


export default MainData
